    false,nt"url": null,nt"notes": "This annual narrative report for Windom
    Wetland Management District summarizes District activities during the 1996 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  Land acquisition is also covered.  The report includes a planning section
    which discusses the master plan.  Administration is outlined; information about
    personnel, volunteer programs, funding, safety, and technical assistance is given.
     Habitat management is also covered.  Subjects include wetlands, croplands, grasslands,
    fire management, pest control, Farmers Home Administration Conservation Easements,
    and private lands.  The wildlife section of the report discusses wildlife diversity,
    waterfowl, marsh birds, water birds, shorebirds, and game mammals.  The public uses
    of the District described in this report include outdoor classrooms, hunting, and
    law enforcement.  The equipment and facilities section of the report provides information
    about rehabilitation and communication systems.  Cooperative programs and items
    of interest are provided at the end; brochures are attached.",nt"owner_org":
